window.bookSummaryJSON = "<p>Dom is the most powerful Techie who has ever lived...and that's exactly the problem, because in a world ruled by rules, he can’t climb the tower.&nbsp;</p> <p>Worse, his mother is dying from a rare disease, the only cure is found on level 33, and no one’s ever made it past level 30.&nbsp;</p> <p>But when he finds a loophole that lets him change his class, he’ll finally get the chance to climb the tower himself and get the cure. Assuming, of course, he doesn’t mind starting over from level one.</p>"; 
